const ProductD = () => {
  return <div>ptod</div>;
};

export default ProductD;

export async function getStaticProps({ prams: { id } }) {
  const res = await fetch(`http://localhost:3000/api/productsdetail/${id}`);
  const data = await res.json();
  console.log(data);
  return {
    props: { product: data },
  };
}
export async function getStaticPaths() {
  return {
    paths: [
      {
        params: { id: "" },
      },
    ],
    fallback: true,
  };
}
